import React, { Component } from 'react';
import { Button } from "react-bootstrap";
import Services from "./Containers/CallServiceContainer";

type Props = {
    isOpenModal: boolean,
    toggleModal?: any
}

class Tasks extends Component<Props> {

    render() {

        const { toggleModal } = this.props;
        const { isOpenModal } = this.props;
        return (
            <div>
                <Button variant={'tulip-large-primary' as any} onClick={toggleModal}>
                    Add Task
                </Button>
                {isOpenModal ? '<div>Open</div>' : '<div>Close</div>'}
                <Services/>
            </div>
        );
    }
}

export default Tasks;
